Notarizes a request. Example in JavaScript: const { notarize } = Host.getFunctions();
const mem = Memory.fromString(JSON.stringify({ url: "https://...", method: "GET", headers: { "authorization": "Bearer xxx", "cookie": "lang=en; auth_token=xxx", }, secretHeaders: [ "authorization: Bearer xxx", "cookie: lang=en; auth_token=xxx", ], getSecretBody: "parseResponse" // See redaction example below
}));
const idOffset = notarize(mem.offset);
const id = Memory.find(idOffset).readString();
Host.outputString(JSON.stringify(id)); // Outputs the notarization ID Redaction If the getSecretResponse field of the notarize host function call is set, the corresponding method will be called to parse the response of the request. Make sure to also export this function in the main module declaration in index.d.ts. function parseResponse() { const bodyString = Host.inputString(); const params = JSON.parse(bodyString); const revealed = `"screen_name":"${params.screen_name}"`; const selectionStart = bodyString.indexOf(revealed); const selectionEnd = selectionStart + revealed.length; const secretResps = [ bodyString.substring(0, selectionStart), bodyString.substring(selectionEnd, bodyString.length), ]; Host.outputString(JSON.stringify(secretResps));
}

