This method is used to request the execution of a plugin by its URL. The plugin will be loaded automatically, and if the user approves, the extension will guide the user through the plugin's steps. Parameters url: The URL to the plugin's WASM file. params (optional) : An object containing user input parameters as key-value pairs. Returns A promise that resolves to the proof data. type ProofData = { notaryUrl: string; session: Session; // https://github.com/tlsnotary/tlsn-js/blob/main/src/types.ts#L7-L11; substrings: Substrings; // https://github.com/tlsnotary/tlsn-js/blob/main/src/types.ts#L73-L76
} Example const proof = await client.runPlugin( "https://github.com/tlsnotary/tlsn-extension/raw/main/plugins/twitter_profile/index.wasm", { Key: "Value" }
